import React, { Component } from 'react'
import { Route, Routes } from "react-router-dom";
import MiddleSection from '../Layout/MiddleSection'

export class RouteFiles extends Component {
  render() {
    return (
        <Routes>
            <Route path='/' element={<MiddleSection/>}/> 
        </Routes> 
    )
  }
}

export default RouteFiles
